    data: |
      SELECT DISTINCT 84 * col0 AS col2 FROM tab2 (FORMAT parquet) WHERE - col2 BETWEEN + col0 * - col2 AND ( + col1 + + CAST ( NULL AS INTEGER ) );
  - name: tab2

outputs:
  - name: q12393.out
    data: |
